INSERT INTO `tb_spu_detail` VALUES (202, '<p class=\"ql-align-center\"><img src=\"https://img20.360buyimg.com/vc/jfs/t2602/55/2515857716/85859/4b2f8ffe/576a7256N8604cb14.jpg\"></p><p class=\"ql-align-center\"><img src=\"https://img20.360buyimg.com/vc/jfs/t2743/222/3676520242/175978/fd1993a0/5795fdc1Nbd5ae56a.jpg\"></p><p><span style=\"color: rgb(255, 255, 255);\">产品信息</span></p><p><span style=\"color: rgb(255, 255, 255);\">Product Information</span></p><p>	ESK 纤薄钢化玻璃贴膜，保证手机画面清晰、给您舒适的视觉享受，采用原料制作，高度还原屏幕色彩。</p><p>	钢化膜表面高分子经过特殊处理，指纹抑制较普通保护膜大大提高。应用钢化玻璃保护膜可以达到淡化指纹效果。</p><p>	采用强化玻璃质，表面HC处理，9H硬度防刮，淡化指纹，防油污，防爆裂，耐高温，防潮湿，经久耐用。</p><p>	使用方便,产品轻薄、美观实用具有防爆和保护双重作用，与手机触摸贴合时方便，排泡性好。</p><p class=\"ql-align-center\"><img src=\"https://img20.360buyimg.com/vc/jfs/t2863/281/3644916462/185648/76d3917e/5795fcd4N4cf4ba78.jpg\"></p><p><span style=\"color: rgb(255, 255, 255);\">产品特色</span></p><p><span style=\"color: rgb(255, 255, 255);\">Selling Point</span></p><p class=\"ql-align-center\"><img src=\"https://img20.360buyimg.com/vc/jfs/t2830/244/3637960188/169288/2c8e5e77/5795fcd1Nc44a33cb.jpg\"></p><p><br></p>', '[{\"group\":\"主体\",\"params\":[{\"k\":\"品牌\",\"searchable\":false,\"global\":true,\"numerical\":false,\"unit\":\"\",\"options\":[],\"v\":\"比亚兹\"},{\"k\":\"适用机型\",\"searchable\":false,\"global\":false,\"numerical\":false,\"unit\":\"\",\"options\":[\"iphone7\",\"iphone8\",\"iphoneX\"]}]},{\"group\":\"规格尺寸\",\"params\":[{\"k\":\"贴膜尺寸\",\"searchable\":true,\"global\":true,\"numerical\":true,\"unit\":\"英寸\",\"options\":[],\"v\":5.5},{\"k\":\"材质\",\"searchable\":true,\"global\":true,\"numerical\":false,\"unit\":\"\",\"options\":[\"钢化玻璃\",\"水凝膜\"],\"v\":\"钢化玻璃\"},{\"k\":\"类型\",\"searchable\":true,\"global\":true,\"numerical\":false,\"unit\":\"\",\"options\":[\"前膜\",\"后膜\",\"磨砂\",\"防指纹\",\"高透膜\"],\"v\":\"高透膜\"}]}]', '{\"适用机型\":[\"iphone8\",\"iphone6\",\"iphone7\"]}', '苹果iPhone 7/6/6s钢化玻璃膜×1、 贴膜工具×1', '本产品全国联保，享受三包服务，质保期为：30天质保');
